import React, {Component, Fragment} from "react";

import Password from "./Password";

let strengthText = [
    {
        text: "Very Weak ☹",
        bgColor: "#e40808"
    },
    {
        text: "Weak ☹",
        bgColor: "#e40808"
    }, {
        text: "Medium ☹",
        bgColor: "#ffd800"
    }, {
        text: "Strong ☺",
        bgColor: "#2cb117"
    }, {
        text: "Very Strong ☻",
        bgColor: "#2cb117"
    }
];

class App extends Component {
    constructor() {
        super();
        this.state = {
          password: '',
        }
      }

    render() {
        return (
            <Fragment>
                <Input type="password" onChange={e => this.setState({ password: e.target.value })}/>
                <Password strength={strengthText} password={this.state.password}/>
            </Fragment>
        );

    }
}

export default App;
